text:
@lillyradermath @marvelousmcc @robertkaplinsky I completely agree. The hard part is getting the data to support that students can "actually" problem solve.

What I mean by this is if scores are lower, that might suggest that they aren't that great solving problems.

*Again issues around tests of 'naked' problems w/o context.

@marvelousmcc @robertkaplinsky First it is important to note that you are working with different groups of students. 

Also, are the assessments based primarily on procedural skills that can be memorized by rote? (Often the case) 

Finally, how intentional are these lessons being selected / implemented? 1/2

@ddmeyer So tough.

First, the thinking shown by the student is amazing. Thinking of each quantity as a "unit" and scaling both down by "thirding". So awesome.

What is tough is that we, math educators, have not been given the support to notice &amp; name the strategies students use to reason

@jgibson314 @MrOrr_geek @MaryBourassa How many kids ‚Äúat a distance‚Äù will it take to get from here (place on playground) to there (place farther away)

Estimate first then reveal total distance in unit of choice...

Can we model it?

