@sadone Hi Doug! Hope all is well. I'm wondering if WECDSB has a Minecraft for Education account and thought you'd be just the person who'd know. 

Context: hoping to sign my kids up for a Minecraft for Edu online "course" through @CodeNinjasWin 

Thanks!

@TeacherTiliches @KarineKelley2 @pwharris Ah, so it sounds like again, language really dictates how you'd unpack this problem. 

This is the problem with "naked" problems without context. 

The language used is what pushes/prompts for a different model. With the very specific language you've used, I'd agree with you.

@TeacherTiliches @KarineKelley2 @pwharris ... you wouldn't see 60 groups of 1/4 simply because saying "1/4 of 60" is actually different than "60 of 1/4".

So even though these are "naked" problems without context, the langage "of" implies that you want 4 groups and not the other way around.

2/2

